<div id="details_ALL" style="font-family:system-ui,Segoe UI,Roboto,Arial,sans-serif;
    margin:8px 0 0 4px; padding:8px; border:1px solid #ddd; border-radius:8px; background:#fafafa;">
  <b>Details:</b> click a point
</div>
<script>
(function(){
  var gd = document.getElementById("plot_ALL");
  if(!gd || !gd.on) return;
  gd.on('plotly_click', function(ev){
    if(!ev || !ev.points || !ev.points.length) return;
    var p = ev.points[0];
    var cd = p.customdata || [];
    var site = cd[0], rec = cd[1], ego = cd[2], nb = cd[3], frame = cd[4], tcaReal = cd[5];
    var txt = "<b>site</b>: " + site
            + " | <b>recordingId</b>: " + rec
            + " | <b>egoId</b>: " + ego
            + " | <b>neighborId</b>: " + nb
            + " | <b>frame</b>: " + frame
            + " | <b>TCA_first (real)</b>: " + tcaReal.toFixed(3) + " s";
    var box = document.getElementById("details_ALL");
    if(box) box.innerHTML = "<b>Details:</b> " + txt;
  });
})();
</script>
